      "excerpt": "<h2 id=\"redis\"><a class=\"header-anchor\" href=\"#redis\">#</a> redis</h2>\n<p>pythonredis//IO</p>\n<p></p>\n<!--beforebegin--><div class=\"language-bash line-numbers-mode\"><!--afterbegin--><pre v-pre class=\"language-bash\"><code>pip3 <span class=\"token function\">install</span> aioredis\n</code></pre>\n<div class=\"line-numbers-wrapper\"><span class=\"line-number\">1</span><br></div><!--beforeend--></div><!--afterend--><p>1</p>\n<!--beforebegin--><div class=\"language-python line-numbers-mode\"><!--afterbegin--><pre v-pre class=\"language-python\"><code><span class=\"token keyword\">import</span> aioredis\n<span class=\"token keyword\">import</span> asyncio\n\n\n<span class=\"token keyword\">async</span> <span class=\"token keyword\">def</span> <span class=\"token function\">execute</span><span class=\"token punctuation\">(</span>address<span class=\"token punctuation\">,</span> password<span class=\"token punctuation\">)</span><span class=\"token punctuation\">:</span>\n    <span class=\"token keyword\">print</span><span class=\"token punctuation\">(</span><span class=\"token string\">\"\"</span><span class=\"token punctuation\">,</span> address<span class=\"token punctuation\">)</span>\n    <span class=\"token comment\"># IOredis</span>\n    redis <span class=\"token operator\">=</span> <span class=\"token keyword\">await</span> aioredis<span class=\"token punctuation\">.</span>create_redis<span class=\"token punctuation\">(</span>address<span class=\"token punctuation\">,</span> password<span class=\"token operator\">=</span>password<span class=\"token punctuation\">)</span>\n\n    <span class=\"token comment\"># IOrediscar3</span>\n    <span class=\"token keyword\">await</span> redis<span class=\"token punctuation\">.</span>hmset_dict<span class=\"token punctuation\">(</span><span class=\"token string\">\"car\"</span><span class=\"token punctuation\">,</span> key1<span class=\"token operator\">=</span><span class=\"token number\">1</span><span class=\"token punctuation\">,</span> key2<span class=\"token operator\">=</span><span class=\"token number\">2</span><span class=\"token punctuation\">,</span> key3<span class=\"token operator\">=</span><span class=\"token number\">3</span><span class=\"token punctuation\">)</span>\n\n    <span class=\"token comment\"># IOredis</span>\n    result <span class=\"token operator\">=</span> <span class=\"token keyword\">await</span> redis<span class=\"token punctuation\">.</span>hgetall<span class=\"token punctuation\">(</span><span class=\"token string\">\"car\"</span><span class=\"token punctuation\">,</span> encoding<span class=\"token operator\">=</span><span class=\"token string\">\"utf-8\"</span><span class=\"token punctuation\">)</span>\n    <span class=\"token keyword\">print</span><span class=\"token punctuation\">(</span>result<span class=\"token punctuation\">)</span>\n\n    redis<span class=\"token punctuation\">.</span>close<span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span>\n    <span class=\"token comment\"># IOredis</span>\n    <span class=\"token keyword\">await</span> redis<span class=\"token punctuation\">.</span>wait_closed<span class=\"token punctuation\">(</span><span class=\"token punctuation\">)</span>\n\n    <span class=\"token keyword\">print</span><span class=\"token punctuation\">(</span><span class=\"token string\">\"\"</span><span class=\"token punctuation\">,</span> address<span class=\"token punctuation\">)</span>\n\n\nasyncio<span class=\"token punctuation\">.</span>run<span class=\"token punctuation\">(</span>execute<span class=\"token punctuation\">(</span><span class=\"token string\">\"redis://127.0.0.1:6379\"</span><span class=\"token punctuation\">,</span> <span class=\"token string\">\"\"</span><span class=\"token punctuation\">)</span><span class=\"token punctuation\">)</span>\n\n</code></pre>\n<div class=\"line-numbers-wrapper\"><span class=\"line-number\">1</span><br><span class=\"line-number\">2</span><br><span class=\"line-number\">3</span><br><span class=\"line-number\">4</span><br><span class=\"line-number\">5</span><br><span class=\"line-number\">6</span><br><span class=\"line-number\">7</span><br><span class=\"line-number\">8</span><br><span class=\"line-number\">9</span><br><span class=\"line-number\">10</span><br><span class=\"line-number\">11</span><br><span class=\"line-number\">12</span><br><span class=\"line-number\">13</span><br><span class=\"line-number\">14</span><br><span class=\"line-number\">15</span><br><span class=\"line-number\">16</span><br><span class=\"line-number\">17</span><br><span class=\"line-number\">18</span><br><span class=\"line-number\">19</span><br><span class=\"line-number\">20</span><br><span class=\"line-number\">21</span><br><span class=\"line-number\">22</span><br><span class=\"line-number\">23</span><br><span class=\"line-number\">24</span><br><span class=\"line-number\">25</span><br></div><!--beforeend--></div><!--afterend-->",
